1 #![no_std] 2 #![no_main] #![no_std] This tells the Rust compiler that this code doesn't use libstd #![no_main] The no_main attribute says that this program won't use the standard main interface, which is usually used when a full operating system is available. Instead of the standard main, we'll use the entry attribute from the esp-riscv-rt crate to define a custom entry point. In this program, we have named the entry point main, but any other name could have been used. The entry point function must be a diverging function . I.e. it has the signature fn foo() -> !; this type indicates that the function never returns ‚Äì which means that the program never terminates. 4 use esp_backtrace as _; 5 use esp_println::println; 6 use esp_hal::{clock::ClockControl, peripherals::Peripherals, prelude::*, timer::TimerGroup, Rtc}; use esp_backtrace as _; Since we are in a bare-metal environment, we need a panic handler that runs if a panic occurs in code There are a few different crates you can use (e.g panic-halt) but esp-backtrace provides an implementation that prints the address of a backtrace - together with espflash these addresses can get decoded into source code locations use esp_println::println; Provides println! implementation use esp_hal::{...} We need to bring in some types we are going to use 8 #[entry] 9 fn main() -> ! {
10 let peripherals = Peripherals::take();
11 let system = peripherals.SYSTEM.split();
12 let clocks = ClockControl::max(system.clock_control).freeze();
13
14 println!("Hello world!");
15
16 loop {}
17 } Inside the main function we can find: let peripherals = Peripherals::take() HAL drivers usually take ownership of peripherals accessed via the PAC Here we take all the peripherals from the PAC to pass them to the HAL drivers later let mut system = peripherals.SYSTEM.split(); Sometimes a peripheral (here the System peripheral) is coarse-grained and doesn't exactly fit the HAL drivers - so here we split the System peripheral into smaller pieces which get passed to the drivers let clocks = ClockControl::max(system.clock_control).freeze(); Here we configure the system clocks - in this case, boost to the maxiumum for the chip We freeze the clocks, which means we can't change them later Some drivers need a reference to the clocks to know how to calculate rates and durations println!("Hello world!"); Prints "Hello world!" loop {} Since our function is supposed to never return, we just "do nothing" in a loop

